'use strict';

const mongoose = require('mongoose');

const schema = new mongoose.Schema({
  id: String,
  label: String,
  ip: String,
  cname: String
}, {
  _id: false,
  minimize: true
});

schema.statics.decorators = [];

module.exports = schema;
